import React from 'react';
import Navbar from './components/Navbar';

const App = () => {
  return (
  <div>

       <div>
        <Navbar/>
       </div>

       <Routers>
        <Route path="/" element={<Home/>}/>
        <Route path="/cart" element={<Cart/>}/>
       </Routers>

  </div>)
};

export default App;
